import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';

function App() {
  useEffect(() => {
    const getData = async () => {
      await fetch('http://127.0.0.1:8000/api/group/')
      .then( resp => resp.json())
      .then( data=> {
        console.log(data);
      })
    }
    getData();
  }, [])
}

export default App;
